import { Outlet, Link } from "react-router-dom";

const Layout = () => {
    return (
        <div>
            <nav>
                <ul>
                    <li>
                        <Link to="App">Home</Link>
                    </li>
                    
                </ul>
            </nav>

            <Outlet />
        </div>
    )
};

export default Layout;
